  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rydell
  National Wildlife Refuge summarizes Refuge activities during the 1992 calendar year.
  The report begins with a summary of the yearu2019s highlights and climatic conditions.
  Land acquisition is also covered. The report includes a planning section which discusses
  the master plan, the management plan, public participation, and compliance with
  environmental and cultural resource mandates.  Refuge administration is outlined;
  information about personnel, volunteer programs, funding, and safety is given. Habitat
  management is also covered. Subjects include wetlands, forests, croplands, grasslands,
  haying, and pest control. The wildlife section of the report discusses wildlife
  diversity, endangered species, threatened species, waterfowl, game mammals, fisheries
  resources, wildlife propagation and stocking, animal control, marking, and banding.
  The public uses of the Refuge described in this report include hunting, fishing,
  wildlife observation, and law enforcement. The equipment and facilities section
  of the report provides information about new construction, rehabilitation, equipment
  utilization and replacement, and energy conservation. Cooperative programs, other
  economic uses of the Refuge, and items of interest are provided at the end.\",\n\t\"owner_org\":
